(lib.doorman_ads_1280x720 = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});
	this.___GetDepth___ = function(obj) {
		var depth = obj.depth;
		var cameraObj = this.___camera___instance;
		if(cameraObj && cameraObj.depth && obj.isAttachedToCamera)
		{
			depth += depth + cameraObj.depth;
		}
		return depth;
		}
	this.___needSorting___ = function() {
		for (var i = 0; i < this.getNumChildren() - 1; i++)
		{
			var prevDepth = this.___GetDepth___(this.getChildAt(i));
			var nextDepth = this.___GetDepth___(this.getChildAt(i + 1));
			if (prevDepth < nextDepth)
				return true;
		}
		return false;
	}
	this.___sortFunction___ = function(obj1, obj2) {
		return (this.exportRoot.___GetDepth___(obj2) - this.exportRoot.___GetDepth___(obj1));
	}
	this.on('tick', function (event){
		var curTimeline = event.currentTarget;
		if (curTimeline.___needSorting___()){
			this.sortChildren(curTimeline.___sortFunction___);
		}
	});
	// timeline functions:
	this.frame_0 = function() {
		if(this.packshot.parent == undefined || this.packshot.parent == this)
		this.packshot = this.packshot.packshot;
		this.clean_room = this.clean.clean_room;
		if(this.get_soda.parent == undefined || this.get_soda.parent == this)
		this.get_soda = this.get_soda.get_soda;
		this.check_guest = this.the_guest.check_guest;
		this.money = this.ui.money;
		if(this.main.parent == undefined || this.main.parent == this)
		this.main = this.main.main;
	}
	this.frame_1 = function() {
		this.___loopingOver___ = true;
		this.stop();
		var main = this.main;
		var boy = main.boy;
		var blonde = main.blonde;
		var stewardes = main.stewardes;
		var sheikh = main.sheikh;
		var roller = main.roller;
		var doors = main.doors;
		var arrows = main.arrows;
		var soda = main.soda;
		var railings = main.railings;
		var clean_room = this.clean_room;
		var get_soda = this.get_soda;
		var check_guest = this.check_guest;
		var money = this.money;
		var packshot = this.packshot;
		var currentDoor = '';
		var floor2 = 65;
		blonde.walkToReception = function() {
			blonde.gotoAndStop('walk');
			cjs.Tween.get(blonde)
			.to({x:-190}, 800)
			.call(() => {
				blonde.bubble.play();
				blonde.gotoAndStop('order');
				setTimeout(()=>{check_guest.play()}, 1000);
				setTimeout(()=>{arrows.visible = true; blonde.bubble.play()}, 1500);		
				setTimeout(()=>{doors.addEventListener('click', doorsClickHandler)}, 3000);		
			})
		}
		blonde.walkToDoor = function(id) {	
			switch (id) {
				case 'door1':
					blonde.scaleX = -1;
					cjs.Tween.get(blonde)
					.call(()=>{blonde.gotoAndStop('walk'); blonde.walk.gotoAndPlay(0)})
					.to({x:-140, y:235}, 200)
					.call(()=>{blonde.gotoAndStop('stairway'); blonde.stairway.gotoAndPlay(0)})
					//.wait(50)
					.to({x:-40, y:140}, 600)
					.call(()=>{blonde.gotoAndStop('walk'); blonde.walk.gotoAndPlay(0)})
					.to({x:-10, y:140}, 200)			
					.call(()=>{blonde.gotoAndStop('stairway'); blonde.stairway.gotoAndPlay(0); main.swapChildren(blonde, railings); blonde.scaleX = 1;})
					//.wait(50)
					.to({x:-110, y:65}, 600)
					.call(()=>{blonde.gotoAndStop('walk'); blonde.walk.gotoAndPlay(0)})
					.to({x:-285, y:65}, 800)
					.call(()=>{blonde.gotoAndStop('idle'), blonde.visible = false; closeDoor(); blonde.scaleX = -1;})
					.wait(1000)
					.call(()=>{blonde.visible = true; blonde.scaleX = -1; blonde.gotoAndStop('order'); openDoor(); blonde.bubble.shape.gotoAndStop(1); blonde.bubble.play()})
					.wait(1000)
					.call(()=>{get_soda.play()})
					.wait(2000)
					.call(()=>{canvas.addEventListener('click', getSodaClickHandler)});
					break;
				case 'door2':
					blonde.scaleX = -1;
					cjs.Tween.get(blonde)

		{

			var focalLength = 528.25;
			var projectionCenter = { 'x' : 0, 'y' : 0};
			if(parent === exportRoot)
			{
				var stageCenter = { 'x' : lib.properties.width/2, 'y' : lib.properties.height/2 };
				projectionCenter.x = stageCenter.x;
				projectionCenter.y = stageCenter.y;
			}
			for(child in parent.children)
			{
				var layerObj = parent.children[child];
				if(layerObj == cameraInstance)
					continue;
				applyLayerZDepth(layerObj, cameraInstance);
				if(layerObj.layerDepth === undefined)
					continue;
				if(layerObj.currentFrame != layerObj.parent.currentFrame)
				{
					layerObj.gotoAndPlay(layerObj.parent.currentFrame);
				}
				var matToApply = new createjs.Matrix2D;
				var cameraMat = new createjs.Matrix2D;
				var totalDepth = layerObj.layerDepth ? layerObj.layerDepth : 0;
				var cameraDepth = 0;
				if(cameraInstance && !layerObj.isAttachedToCamera)
				{
					var mat = cameraInstance.getMatrix();
					mat.tx -= projectionCenter.x;
					mat.ty -= projectionCenter.y;
					cameraMat = mat.invert();
					cameraMat.prependTransform(projectionCenter.x, projectionCenter.y, 1, 1, 0, 0, 0, 0, 0);
					cameraMat.appendTransform(-projectionCenter.x, -projectionCenter.y, 1, 1, 0, 0, 0, 0, 0);
					if(cameraInstance.depth)
						cameraDepth = cameraInstance.depth;
				}
				if(layerObj.depth)
				{
					totalDepth = layerObj.depth;
				}
				//Offset by camera depth
				totalDepth -= cameraDepth;
				if(totalDepth < -focalLength)
				{
					matToApply.a = 0;
					matToApply.d = 0;
				}
				else
				{
					if(layerObj.layerDepth)
					{
						var sizeLockedMat = getProjectionMatrix(parent, layerObj.layerDepth);
						if(sizeLockedMat)
						{
							sizeLockedMat.invert();
							matToApply.prependMatrix(sizeLockedMat);
						}
					}
					matToApply.prependMatrix(cameraMat);
					var projMat = getProjectionMatrix(parent, totalDepth);
					if(projMat)
					{
						matToApply.prependMatrix(projMat);
					}
				}
				layerObj.transformMatrix = matToApply;
			}
		}
	}	    
	//Code to support hidpi screens and responsive scaling.
	function makeResponsive(isResp, respDim, isScale, scaleType) {		
		var lastW, lastH, lastS=1;		
		window.addEventListener('resize', resizeCanvas);		
		resizeCanvas();		
		resizeCanvas();	
		function resizeCanvas() {			
			var w = lib.properties.width, h = lib.properties.height;			
			var iw = window.innerWidth, ih=window.innerHeight;	
			if (iw < ih) h = lib.properties.width, w = lib.properties.height;			
			var pRatio = window.devicePixelRatio || 1, xRatio=iw/w, yRatio=ih/h, sRatio=1;
			if(isResp) {                
				if((respDim=='width'&&lastW==iw) || (respDim=='height'&&lastH==ih)) {                    
					sRatio = lastS;                
				}				
				else if(!isScale) {					
					if(iw<w || ih<h)						
						sRatio = Math.min(xRatio, yRatio);				
				}				
				else if(scaleType==1) {					
					sRatio = Math.min(xRatio, yRatio);				
				}				
				else if(scaleType==2) {					
					sRatio = Math.max(xRatio, yRatio);				
				}			
			}			
			canvas.width = w*pRatio*sRatio;			
			canvas.height = h*pRatio*sRatio;
			canvas.style.width = dom_overlay_container.style.width = anim_container.style.width =  w*sRatio+'px';				
			canvas.style.height = anim_container.style.height = dom_overlay_container.style.height = h*sRatio+'px';
			stage.scaleX = pRatio*sRatio;			
			stage.scaleY = pRatio*sRatio;			
			lastW = iw; lastH = ih; lastS = sRatio;            
			stage.tickOnUpdate = false;            
			stage.update();            
			stage.tickOnUpdate = true;		
		}
	}
	makeResponsive(true,'both',true,1);	
	AdobeAn.compositionLoaded(lib.properties.id);
	//fnStartAnimation();

	if (mraid.getState() === 'loading') {	    
	    mraid.addEventListener('ready', onSdkReady); 
	} else {	   
	    onSdkReady(); 
	}
	
	function onSdkReady() {
		fnStartAnimation();	       
	   	mraid.removeEventListener('ready', onSdkReady); 	   
	}
}
</script>
